import React from "react";
import Head from "next/head";
import Style from "../style/style";
import Footer from "../components/Footer";

class App extends React.Component {
  style_back = {
    backgroundColor: "#42AAC7",
    height: "720px"
  };
  render() {
    return (
      <div>
        <html lang="ja" />
        <Head>
          <title>Reactとは</title>
          <meta charSet="utf-8" />
          <meta
            name="viewport"
            content="initial-scale=1.0,width=divice-width"
          />
          <link
            href="https://fonts.googleapis.com/css?family=Ma+Shan+Zheng&display=swap"
            rel="stylesheet"
          ></link>
        </Head>
        {Style}
        <div style={this.style_back}>
          <h1>Reactとは？</h1>
          <Footer go="./Page2" />
        </div>
      </div>
    );
  }
}

export default App;
